import React from 'react'


const Personajes = ({personaje = []}) =>{

    return(

    <div >
                  { personaje.map(pers => {
                      return <div key={pers.id} className='card'>
                                <img src={pers.image} alt="" />   
                     </div>
                  })
                  }
    </div>
)
}

export default Personajes
